package com.mtelecom.vanhack;

import static org.junit.Assert.assertEquals;
import static org.junit.Assert.assertTrue;

import org.junit.Ignore;
import org.junit.Test;

/**
 * Unit test for simple Vowel.
 */
public class VowelTest {

    @Test
    public void vowel0() {
        assertEquals(1, Vowel.vowelsubstring("aaeiouxa"));
    }

    @Test
    public void vowel1() {
        assertEquals(1, Vowel.vowelsubstring("axyzaeiou"));
    }

    @Test
    public void vowel2() {
        assertEquals(1, Vowel.vowelsubstring("bcaekfaaeioau"));
    }

    @Test
    @Ignore
    public void vowel3() {
        assertEquals(15, Vowel.vowelsubstring(""));
    }

    @Test
    @Ignore
    public void vowel4() {
        assertEquals(25, Vowel.vowelsubstring(""));
    }

    @Test
    @Ignore
    public void vowel5() {
        assertEquals(35, Vowel.vowelsubstring(""));
    }

    @Test
    @Ignore
    public void vowel6() {
        assertEquals(45, Vowel.vowelsubstring(""));
    }

    @Test
    @Ignore
    public void vowel7() {
        assertEquals(1, Vowel.vowelsubstring(""));
    }


}
